import React from "react"

const Nav = (func, descr) => {
    return(
        <div className="w-screen flex p-4">
            <img src="https://via.placeholder.com/180x60" alt="" />
            <button className="border-pink-600 border-2 font-bold rounded-full text-right py-3 px-6 text-pink-400 hover:bg-pink-600 hover:border-pink-600 hover:text-white" onClick={func}>{descr}</button>
        </div>

    )
}

export default Nav
